import React, {useState} from "react";
import TakeMeHome from "../TakeMeHome";
import { Link } from "react-router-dom";
import PDF from "../resume.pdf";


const SoftwareEngineer = () => {

    const [displayPdf, setDisplayPdf] = useState(false);

    return (
  <div className="text-hot-red max-h-screen absolute inset-0 flex flex-col items-center justify-center gap-10 swe-page-font">
    <TakeMeHome />
    <Link>
      <h2 className="text-4xl text-sm:text-2xl">Introduction</h2>
    </Link>
    <Link>
      <h2 className="text-4xl text-sm:text-2xl">The Code I live By </h2>
    </Link>
    <Link>
      <h2 className="text-4xl text-sm:text-2xl">Works</h2>
    </Link>
    {/* <a href = {PDF} target = "_blank" rel="noreferrer">
      <h2 className="text-4xl text-sm:text-2xl">Resume</h2>
      </a> */}
        <button>
        <h2 className="text-4xl text-sm:text-2xl" onClick={() => setDisplayPdf(true)}>Resume</h2>
        </button>
  </div>
)};

export default SoftwareEngineer;
